module mux_4to1(input [3:0] in, input [1:0] select, output reg out);
	always @(in, select)
	begin
		if (select == 2'b00)
			out = in[0];
		else if (select == 2'b01)
			out = in[1];
		else if (select == 2'b10)
			out = in[2];
		else
			out = in[3];
	end
endmodule

module mux_8to1(input [7:0] in, input [2:0] select, output reg out);
